// Обработка массива справочника. В качестве параметров передаем - массив, мнемо справочника, после необходимые реквизиты.
// Пример вызова: creatRecords(CelevyeStati, 'tap.CelevyeStati', 'tap.CelevyeStati.Biudzhet');
function creatRecords(...args) {
    for (let entry of args[0]) {
        let catalogRow = EntityFactory.createCatalogRecord(args[1]);
        catalogRow.setCode(entry[0]);
        catalogRow.setTitle(entry[1]);
        for (let i=2; i<args.length; i++) {
            if (entry[i] !== '')
                catalogRow.set(args[i], entry[i]);
        }
    catalogRow.save();
    }
}




